          })
          .zIndex(1)
          .position({
            x: Const.WebConstant_PROGRESS_POSITION_X,
            y: Const.WebConstant_PROGRESS_POSITION_Y
          })
      }
    }
    .backgroundColor($r('app.color.navy_blue'))
  }
}

