              this.webController.runJavaScript('startDraw()');
            })
        }
        .width(Const.WebConstant_FULL_WIDTH)
        .height(Const.WebConstant_FULL_HEIGHT)
      }

      if (this.isLoading) {
        Progress({
          value: Const.WebConstant_PROGRESS_MIN,
