          type: ProgressType.ScaleRing
        })
          .color(Color.Grey)
          .value(this.progressVal)
          .width(Const.WebConstant_PROGRESS_WIDTH)
          .style({
            strokeWidth: Const.WebConstant_PROGRESS_STROKE_WIDTH,
